import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Navbar from "./components/Navbar"; // <-- ADDED: Import Navbar component
import About from "./pages/About";
import Portfolio from "./pages/Portfolio";
import Resume from "./pages/Resume";
import "./styles.css"; // <-- ADDED: Import global styles

function App() {
  return (
    <Router>
      <Navbar /> {/* <-- ADDED: Include Navbar at the top */}
      <div className="container"> {/* <-- ADDED: Wrap content for styling */}
        <Routes>
          <Route path="/" element={<About />} />
          <Route path="/portfolio" element={<Portfolio />} />
          <Route path="/resume" element={<Resume />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
